import React from "react";
import {FirstName} from "./App";


const Comp3 = () =>{
return (
    <>
    <FirstName.Consumer>{(fname)=>{
        return (
            <h1>Hey {fname}</h1>
        )
    }}</FirstName.Consumer>
    </>
)
}


export default Comp3;
